DROP PROCEDURE IF EXISTS `ApproveArticle`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `ApproveArticle` (IN `target_articleID` INT)   BEGIN
    UPDATE articles
    SET status = 'approved',
        publicationDate = NOW()
    WHERE articleID = target_articleID;
END$$

DROP PROCEDURE IF EXISTS `AssignReport`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `AssignReport` (IN `p_reportID` INT, IN `p_itID` VARCHAR(10))   BEGIN
    DECLARE v_incident_type VARCHAR(50);
    DECLARE v_current_status VARCHAR(20);
    
    -- 1. Get current report details (for logging)
    SELECT incidentType, status INTO v_incident_type, v_current_status
    FROM reports 
    WHERE reportID = p_reportID;
    
    -- 2. Validate report exists
    IF v_incident_type IS NULL THEN
        SIGNAL SQLSTATE '45000' 
        SET MESSAGE_TEXT = 'Report not found';
    END IF;
    
    -- 3. Update assignment
    UPDATE reports
    SET itPersonnelID = p_itID,
        status = 'under review'
    WHERE reportID = p_reportID;
    
    -- 4. Log the assignment
    INSERT INTO ReportLog (
        reportID, 
        incidentType, 
        status, 
        resolutionDetails, 
        logTimestamp, 
        itPersonnelID
    ) VALUES (
        p_reportID,
        v_incident_type,
        'under review',
        CONCAT(
            'Manually assigned from ', 
            IFNULL(v_current_status, 'unassigned'), 
            ' to IT: ', p_itID
        ),
        NOW(),
        p_itID
    );
END$$

DROP PROCEDURE IF EXISTS `search_articles_by_keyword`$$
CREATE DEFINER=`root`@`localhost` PROCEDURE `search_articles_by_keyword` (IN `keyword` VARCHAR(255))   BEGIN
    SELECT 
        a.articleID,
        a.title,
        a.content,
        a.submissionDate,
        a.status,
        u.username AS submittedBy
    FROM 
        articles a
    JOIN 
        users u ON a.userID = u.userID
    WHERE 
        a.title LIKE CONCAT('%', keyword, '%') 
        OR a.content LIKE CONCAT('%', keyword, '%');
END$$

