DROP TRIGGER IF EXISTS `tr_article_approval`;
DELIMITER $$
CREATE TRIGGER `tr_article_approval` BEFORE UPDATE ON `articles` FOR EACH ROW BEGIN
    -- Update publication date ONLY when status changes to approved
    IF NEW.status = 'approved' AND OLD.status != 'approved' THEN
        SET NEW.publicationDate = NOW();
    END IF;
    
    -- Optional: Clear date if un-approved
    IF NEW.status != 'approved' AND OLD.status = 'approved' THEN
        SET NEW.publicationDate = NULL;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `tr_article_submission`;
DELIMITER $$
CREATE TRIGGER `tr_article_submission` BEFORE INSERT ON `articles` FOR EACH ROW BEGIN
    -- Set default values for new articles
    SET NEW.submissionDate = NOW();
    
    -- Admin-published articles are automatically approved
    IF (SELECT userType FROM users WHERE userID = NEW.userID) = 'Admin' THEN
        SET NEW.status = 'approved';
        SET NEW.publicationDate = NOW();
    ELSE
        -- Regular users' submissions start as pending
        SET NEW.status = 'pending';
        SET NEW.publicationDate = NULL;
    END IF;
END
$$
DELIMITER ;

