DROP TRIGGER IF EXISTS `tr_auto_assign_it_personnel`;
DELIMITER $$
CREATE TRIGGER `tr_auto_assign_it_personnel` BEFORE INSERT ON `reports` FOR EACH ROW BEGIN
    DECLARE v_reporter_college VARCHAR(100);
    DECLARE v_it_personnel VARCHAR(10);
    
    -- Only process non-anonymous reports with no existing assignment
    IF NEW.userID IS NOT NULL AND NEW.itPersonnelID IS NULL THEN
        -- 1. Get reporter's college/department
        SELECT college_department INTO v_reporter_college
        FROM users 
        WHERE userID = NEW.userID;
        
        -- 2. Find matching IT personnel from same college
        IF v_reporter_college IS NOT NULL THEN
            SELECT userID INTO v_it_personnel
            FROM users
            WHERE userType = 'IT Personnel'
              AND college_department = v_reporter_college
            ORDER BY (
                SELECT COUNT(*) 
                FROM Reports 
                WHERE itPersonnelID = users.userID 
                AND status = 'under review'
            ) ASC
            LIMIT 1;
            
            -- 3. Assign if found
            IF v_it_personnel IS NOT NULL THEN
                SET NEW.itPersonnelID = v_it_personnel;
            END IF;
        END IF;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `tr_log_manual_it_assignment`;
DELIMITER $$
CREATE TRIGGER `tr_log_manual_it_assignment` AFTER UPDATE ON `reports` FOR EACH ROW BEGIN
    -- Log when IT personnel is manually assigned/changed
    IF NEW.itPersonnelID != OLD.itPersonnelID THEN
        INSERT INTO ReportLog (
            reportID, 
            incidentType, 
            status, 
            resolutionDetails, 
            logTimestamp, 
            itPersonnelID
        ) VALUES (
            NEW.reportID, 
            NEW.incidentType, 
            NEW.status, 
            CONCAT(
                'IT assignment ',
                CASE 
                    WHEN OLD.itPersonnelID IS NULL THEN 'set to '
                    ELSE 'changed from ' || OLD.itPersonnelID || ' to '
                END,
                NEW.itPersonnelID
            ), 
            NOW(), 
            NEW.itPersonnelID
        );
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `tr_report_status_change`;
DELIMITER $$
CREATE TRIGGER `tr_report_status_change` AFTER INSERT ON `reports` FOR EACH ROW BEGIN
    -- Always create initial log entry, using COALESCE for NULL itPersonnelID
    INSERT INTO ReportLog (
        reportID, 
        incidentType, 
        status, 
        resolutionDetails, 
        logTimestamp, 
        itPersonnelID
    ) VALUES (
        NEW.reportID, 
        NEW.incidentType, 
        NEW.status, 
        CONCAT(
            'Report created', 
            CASE WHEN NEW.userID IS NULL THEN ' anonymously' ELSE '' END,
            CASE WHEN NEW.itPersonnelID IS NOT NULL 
                 THEN CONCAT(' | Assigned to IT: ', NEW.itPersonnelID) 
                 ELSE '' END
        ), 
        NOW(), 
        NEW.itPersonnelID  -- This will be NULL or the manually assigned value
    );
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `tr_report_status_update`;
DELIMITER $$
CREATE TRIGGER `tr_report_status_update` AFTER UPDATE ON `reports` FOR EACH ROW BEGIN
    -- For status changes on existing reports
    IF OLD.status != NEW.status THEN
        INSERT INTO ReportLog (reportID, incidentType, status, resolutionDetails, logTimestamp, itPersonnelID)
        VALUES (NEW.reportID, NEW.incidentType, NEW.status, 
               CONCAT('Status changed from ', OLD.status, ' to ', NEW.status), 
               NOW(), NEW.itPersonnelID);
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `tr_set_anonymous_flag`;
DELIMITER $$
CREATE TRIGGER `tr_set_anonymous_flag` BEFORE INSERT ON `reports` FOR EACH ROW BEGIN
    -- If userID is NULL, set anonymousFlag to TRUE (1)
    IF NEW.userID IS NULL THEN
        SET NEW.anonymousFlag = TRUE;
    ELSE
        -- Explicitly set to FALSE if userID exists (optional)
        SET NEW.anonymousFlag = FALSE;
    END IF;
END
$$
